import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  IconButton,
  Badge,
  Menu,
  MenuItem,
  Avatar,
  CssBaseline,
  ThemeProvider,
  createTheme
} from '@mui/material';
import {
  Dashboard as DashboardIcon,
  Notifications,
  ExitToApp,
  Person
} from '@mui/icons-material';
import AuthComponent from './components/AuthComponent';
import Dashboard from './components/Dashboard';
import AlertsComponent from './components/AlertsComponent';
import { authService, alertService } from './services/api';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

interface User {
  username: string;
  email: string;
}

const App: React.FC = () => {
  const [user, setUser] = useState<User | null>(null);
  const [currentPage, setCurrentPage] = useState('dashboard');
  const [unreadCount, setUnreadCount] = useState(0);
  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);

  useEffect(() => {
    const token = localStorage.getItem('token');
    const savedUser = localStorage.getItem('user');

    if (token && savedUser) {
      setUser(JSON.parse(savedUser));
      loadUnreadCount();
    }
  }, []);

  const loadUnreadCount = async () => {
    try {
      const count = await alertService.getUnreadCount();
      setUnreadCount(count);
    } catch (err) {
      console.error('BÅ‚Ä…d podczas Å‚adowania liczby alertÃ³w');
    }
  };

  const handleLogin = (token: string, userData: User) => {
    setUser(userData);
    loadUnreadCount();
  };

  const handleLogout = () => {
    authService.logout();
    setUser(null);
    setCurrentPage('dashboard');
    setAnchorEl(null);
  };

  const handleMenuOpen = (event: React.MouseEvent<HTMLElement>) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  if (!user) {
    return (
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <AuthComponent onLogin={handleLogin} />
      </ThemeProvider>
    );
  }

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              ðŸ“Š StockWatch
            </Typography>

            <Button
              color="inherit"
              startIcon={<DashboardIcon />}
              onClick={() => setCurrentPage('dashboard')}
              sx={{
                mr: 2,
                backgroundColor: currentPage === 'dashboard' ? 'rgba(255,255,255,0.1)' : 'transparent'
              }}
            >
              Dashboard
            </Button>

            <IconButton
              color="inherit"
              onClick={() => setCurrentPage('alerts')}
              sx={{
                mr: 2,
                backgroundColor: currentPage === 'alerts' ? 'rgba(255,255,255,0.1)' : 'transparent'
              }}
            >
              <Badge badgeContent={unreadCount} color="error">
                <Notifications />
              </Badge>
            </IconButton>

            <IconButton color="inherit" onClick={handleMenuOpen}>
              <Avatar sx={{ width: 32, height: 32, bgcolor: 'secondary.main' }}>
                <Person />
              </Avatar>
            </IconButton>

            <Menu
              anchorEl={anchorEl}
              open={Boolean(anchorEl)}
              onClose={handleMenuClose}
            >
              <MenuItem disabled>
                <Box>
                  <Typography variant="subtitle2">{user.username}</Typography>
                  <Typography variant="caption" color="textSecondary">
                    {user.email}
                  </Typography>
                </Box>
              </MenuItem>
              <MenuItem onClick={handleLogout}>
                <ExitToApp sx={{ mr: 2 }} />
                Wyloguj siÄ™
              </MenuItem>
            </Menu>
          </Toolbar>
        </AppBar>

        <Box component="main">
          {currentPage === 'dashboard' && <Dashboard />}
          {currentPage === 'alerts' && <AlertsComponent />}
        </Box>
      </Box>
    </ThemeProvider>
  );
};

export default App;
